import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Typography from '@material-ui/core/Typography';
import { withStyles } from '@material-ui/core/styles';


 const Partners = () =>{
  
  const [data, setData] = React.useState({
    error: '',
    data: [],
    temp: [],
    error: null,
    search: null,
    

  });
  const [q, setQ] = useState("");


  const CustomTableCell = withStyles(theme => ({
    body: {
      borderBottomColor: 'transparent',
      paddingTop: theme.spacing(1),
      paddingBottom: theme.spacing(1)
    }
  }))(TableCell);

  useEffect(() => {
    setTimeout(async () => {

      getData()
     
        let restaurantid;
        restaurantid = null;
        try {
          restaurantid = await AsyncStorage.getItem('restaurant_id');
        } catch (e) {
          console.log(e);
        }
       
        console.log('focused section');
      }
    
  

    , 500);


  }, [])

  const getData = async () => {
    const url = 'https://api.foodealzapi.com/restaurants';
    let user;
    user = [];
    await fetch(url)
      .then(res => res.json())
      .then(res => {
        console.log(res)
        setData({
          ...data,
          data: res,
          temp: res,

        });
      })
      .catch(error => {
        setData({
          ...data,
          error: 'Error Loading content',
        })
      })
  };

  const searchFilterFunction = (text) => {
    const newData = data.temp.filter((item) => {
      const itemData = `${item.nom.toUpperCase()}`;
      const textData = text.toUpperCase();
      return itemData.indexOf(textData) > -1;
    });
    setData({
      ...data,
      data: newData
    })
  };
 const Title1 = {
  fontSize: '20px',
  color: '#008037',
  fontWeight: 'bold',
  marginLeft: '20px',
  justifyContent: 'center'
 }

 const Search1 = {
  
  backgroundColor: 'white',
  marginLeft: '20px',
  borderBottomWidth: 1,
  borderBottomColor: '#b4b4b4b4b4'
 }
 const item = { 
  fontSize: '12px',
  flexDirection: 'row',
  marginLeft: '15px',
  fontWeight: 'bold'
 }
return (
  <div>
      <div style={Title1}>
          <h2>Partners</h2> 

      </div>
      <div style={Search1} >
      <input type="text" placeholder=" Search Here..." value={q} onChange={(e) => setQ(e.target.value)} />
      </div>
      <div style={item}>
      <Table>
            <TableHead>
              <TableRow>
                <CustomTableCell>partnerId</CustomTableCell>
                <CustomTableCell align="right">partnerName</CustomTableCell>
                <CustomTableCell align="right">partnerMail</CustomTableCell>
                <CustomTableCell align="right">partnerPhone</CustomTableCell>
                
                <CustomTableCell align="right">partnerPassword</CustomTableCell>
                <CustomTableCell align="right">partnerCity</CustomTableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {data.data.map((item, index) => (
                <TableRow key={restaurant_id}>
                  {/* <CustomTableCell>
                    <Typography variant="body1" className="font-weight-bold">
                      {item.title}
                    </Typography>
                    <Typography variant="body1">{item.subtitle}</Typography>
                  </CustomTableCell>
                  <CustomTableCell align="right">
                    {formatPrice(item.price)}
                  </CustomTableCell>
                  <CustomTableCell align="right">
                    {item.quantity}
                  </CustomTableCell>
                  <CustomTableCell align="right">
                    {formatPrice(item.price * item.quantity)}
                  </CustomTableCell> */}
                </TableRow>
               ))} 
            </TableBody>
            </Table>
       
      </div>
      <div> 
        
      </div>
     
  </div>
)
 }
export default Partners;
